import { useState } from "react";

import "../style/ourBrands.css";

function OurBrands() {
	return (
		<div className='our_brand_container'>
			<div className='brands_text_container'>
				<div className='brands_text'>Brands</div>
				<div className='brands_decoration'></div>
				<div className='collection_link'></div>
			</div>
			<div className='brands_imgs_container'>{}</div>
		</div>
	);
}

export default OurBrands;
